description:
Riley Evans finally convinced her neighbor, Bill, to stop by her place.
She lures him in with the promise of dinner, but she's more interested
in dessert and you can't have dessert without whip cream.
She makes sure to top her big tits off with whip cream and
has Bill lick it off before fucking his brains out on the
kitchen floor and counter.
It was definitely a better meal than what Bill was expecting.
